import React, { useEffect, useState } from 'react';
import {apiCall} from './utils/apiCall'


function App(){

    const [todos, setTodos] = useState([]);


    useEffect(()=>{
        getTodos();
    }, [])

    function getTodos(){
        apiCall('/todo', 'get').then(res=>{
            setTodos(res.data)
            console.log(res.data);
        })
    }


    return (
        <div>
            hello world
        </div>
    )
}

export default App;
